    "2016-07-27T22:20:16.208670",nt"name": "stillwater-wildlife-management-area-anaho-island-national-wildlife-refuge-and-fallon-natio",nt"isopen":
    false,nt"url": null,nt"notes": "The Fallon, Stillwater and Anaho Island
    National Wildlife Refuges are located in northwest Nevada and are administered by
    the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
    Wildlife Management Area (SWMA). The weather in 1971 was fairly normal with typical
    high and low swings. Water conditions were very good and reservoir storage was high.
     Overall aquatic plant production was good and somewhat better than last year.
    A task force report was devised upon the completion of an investigation on water
    location for Pyramid Lake. Suggestions were made to refuge as to conserve water
    to prevent loss by inefficient management. Marsh conditions deteriorated considerably
    below last yearu2019s level due to the inability to drain over the winter season.
    Signing was a major focus in the development and maintenance of the refuge. Grazing
    was good this year and the livestock were in excellent shape at summeru2019s end.",nt"license_title":
